"use strict";(self.webpackChunkwebsite=self.webpackChunkwebsite||[]).push([[2162],{50422:e=>{e.exports=JSON.parse('{"tag":{"label":"ctf_18.3","permalink":"/teamforge/docs/tags/ctf-18-3","allTagsPath":"/teamforge/docs/tags","count":15,"items":[{"id":"BaselinePages/baseline-settings","title":"Baseline Settings","description":"As a baseline administrator, you can configure the custom attributes used in the baselines, configure the custom statuses, and manage workflow status transitions and field inclusions.","permalink":"/teamforge/docs/BaselinePages/baseline-settings"},{"id":"BaselinePages/compare-baselines","title":"Compare Baselines and Baseline Definitions","description":"You can compare two Baselines created at two different points in time to know the differences. You can also compare the Baseline Definitions of two Baselines.","permalink":"/teamforge/docs/BaselinePages/compare-baselines"},{"id":"BaselinePages/create-baseline","title":"Create and View Baselines","description":"Create a Baseline when you accomplish specific milestones in your project or when you release or deliver a product. You can create a Baseline from either a Baseline Definition or from the ground up.","permalink":"/teamforge/docs/BaselinePages/create-baseline"},{"id":"BaselinePages/create-project-baseline","title":"Create and View Project Baselines","description":"A Project Baseline is a baseline created on a project at a given point in time. Once you have Project Baselines created, you can kick start new projects from Project Baselines and proceed from when and where the Project Baselines were created in the past. Project Baselines are typically created using Project Baseline Definitions, when you release or deliver a product. You can create as many Project Baselines as required.","permalink":"/teamforge/docs/BaselinePages/create-project-baseline"},{"id":"BaselinePages/create-baseline-def","title":"Create, View, and Delete Baseline Definitions","description":"A Baseline Definition is the filter criteria that is used to create a Baseline from a set of selected configuration items such as Tracker Artifacts, Documents, Source Code Repositories (only Git and Subversion are supported), File Releases, and Binaries (only Nexus binaries are supported) in a given TeamForge project.","permalink":"/teamforge/docs/BaselinePages/create-baseline-def"},{"id":"BaselinePages/edit-baseline-def","title":"Edit Baseline Definitions","description":"You can edit an existing Baseline Definition to add more filter criteria or modify the existing fields and filter criteria.","permalink":"/teamforge/docs/BaselinePages/edit-baseline-def"},{"id":"BaselinePages/edit-baseline","title":"Edit Baselines","description":"You can edit the existing fields in a Baseline as long as the Baseline is in open status. A Baseline cannot be edited after it is approved or rejected.","permalink":"/teamforge/docs/BaselinePages/edit-baseline"},{"id":"installpages/distributed_install_rhel_centos","title":"Install TeamForge in a Distributed Setup","description":"Distributed setup with TeamForge, Database (including Datamart), Review Board, SCM (Subversion and Git), Code Search and Baseline installed on separate servers.","permalink":"/teamforge/docs/installpages/distributed_install_rhel_centos"},{"id":"installpages/requirements","title":"Installation Requirements","description":"Here\'s what it takes to install and run TeamForge and other integrations supported by TeamForge.","permalink":"/teamforge/docs/installpages/requirements"},{"id":"installpages/plan_your_installation_upgrade","title":"Plan Your Installation / Upgrade","description":"Plan your installation or upgrade setup, hardware and software requirements and so on before you begin.","permalink":"/teamforge/docs/installpages/plan_your_installation_upgrade"},{"id":"BaselinePages/baseline-review-approval-workflow","title":"Review Baselines","description":"A Baseline or a Project Baseline, once created can be reviewed. During the review cycle, the Baseline or the Project Baseline undergoes various status transitions as defined by the Baseline Administrator.","permalink":"/teamforge/docs/BaselinePages/baseline-review-approval-workflow"},{"id":"release-notes/siteoptionschangelog","title":"Site Options Change Log","description":"Change log of site-options.conf tokens.","permalink":"/teamforge/docs/release-notes/siteoptionschangelog"},{"id":"BaselinePages/baseline-overview","title":"TeamForge Baseline - An Overview","description":"What is a Baseline Definition?","permalink":"/teamforge/docs/BaselinePages/baseline-overview"},{"id":"scripts/teamforgescript","title":"The teamforge.py Script","description":"Use the teamforge.py script to deploy and undeploy services, start and stop services, verify the status of services, verify the application environment, bootstrap or migrate data, back up and restore data and do much more.","permalink":"/teamforge/docs/scripts/teamforgescript"},{"id":"internalcodebrowser","title":"Work with the Internal Code Browser","description":"For Subversion and Git repositories, you have the option to use the TeamForge code browser which is turned on by default while integrating the source code server.","permalink":"/teamforge/docs/internalcodebrowser"}],"unlisted":false}}')}}]);